import React from 'react';
import './Sb.css'


function Sb() {
    return (
        <container>
            <div className="login">
                <a href="/SignUp">Sign Up </a>
            </div>
            <div className="sign">
                <a href="/Login">Login </a>
            </div>
        </container>
    );
}

export default Sb;
